class Solution {
    /**
     * @param String $s
     * @param Integer $k
     * @return Integer
     */
    function beautifulSubstrings($s, $k) {
        $n = strlen($s);
        $count = 0;
        for ($i = 0; $i < $n; $i++) {
            $freq = array_fill(0, 2, 0); // [0] for vowels, [1] for consonants
            for ($j = $i; $j < $n; $j++) {
                if (strpos('aeiou', $s[$j]) !== false) {
                    $freq[0]++;
                } else {
                    $freq[1]++;
                }
                if ($freq[0] == $freq[1] && ($freq[0] * $freq[1]) % $k == 0) {
                    $count++;
                }
            }
        }
        return $count;
    }
}
